  showHashTagListAPI() {
    let abc;

    if (this.count === undefined) {
      abc = '0';
    } else {
      abc = this.count;
    }

    axios.post(`https://freedomcells.net/freedomcell/api/users/hashtag_list`, {
      'user_id': this.loginData.id,
      'api_key': this.loginData.api_key,
      "offset": abc,
      "limit": "5"
    }).then(res => {
      //on success
      this.codeDataHashTagList = res.data.code;

      if (this.codeDataHashTagList === true) {
        this.setState({
          listoffset: res.data.offset,
          listCount: res.data.count,
          listHashTagList: res.data.hashtags,
          pageCount: Math.ceil(20 / 5)
        });
      } else if (this.codeDataHashTagList === false) {
        this.setState({
          listHashTagList: []
        });
      }

      document.body.scrollTop = document.documentElement.scrollTop = 0;
    }).catch(error => {});
  }

